var rootUrl = "http://localhost:8081/file";
var pdfListCache = [];

function html2pdf() {
    var htmlStr = $("#htmlStr").val();
    console.log(htmlStr);
    if (htmlStr.length < 1) {
        alert("请输入html");
        return false;
    }
    var data = {
        // htmlStr: defaultHtmlStr.first + htmlStr + defaultHtmlStr.last,
        // htmlStr: defaultHtmlStr2.first + htmlStr + defaultHtmlStr2.last,
        // htmlStr: defaultHtmlStr3.first + htmlStr + defaultHtmlStr3.last,
        htmlStr: htmlStr,
        original: $("#original:checked").val(),
        pdfName: $("#pdfName").val(),
        pageSize: $("#pageSize").val(),
        imageUrl: $("#imageUrl").val(),
        imagePosition: $("#imagePosition").val(),
    };
    console.log(data);
    $.ajax({
        url: rootUrl + "/html2pdf",
        type: "POST",
        data: data,
        success: function (result) {
            pdfListCache.push(result.data);
            foreachPdfList();
        }
    })
}

function foreachPdfList() {
    $("#pdfList").html("");
    pdfListCache.flatMap(value => {
        $("#pdfList").append(`<li id="${value}">
                        <b>${value}</b>
                            <button onclick="controlDiv(1, '${value}')">预览</button>
                    </li>`);
    });
}

