//蒙版控制
function controlDiv(flag, value) {
    if(flag == 1 && undefined == value) {
        alert("file is error!");
        return false;
    }
    var headUrl = "./web/viewer.html?file=";
    var downUrl = encodeURIComponent("http://localhost:8081/file/down?pdfName=");
    $("#pcitc_popWindow #content").attr("src", headUrl + downUrl + value);
    var popWindow =  $("#pcitc_popWindow");
    var maskLayer =  $("#pcitc_popWindow #maskLayer");
    switch (flag) {
        case 0:
            popWindow.hide();
            maskLayer.hide();
            break;
        case 1:
            popWindow.show();
            maskLayer.show();
            break;
        default:
            popWindow.hide();
            maskLayer.hide();
            break;
    }
}



